import os

import pygame, sys, base64, os, time
from pygame.locals import *

pygame.init()
#add konami code
konami = [pygame.K_UP, pygame.K_UP, pygame.K_DOWN, pygame.K_DOWN, pygame.K_LEFT, pygame.K_RIGHT, pygame.K_LEFT, pygame.K_RIGHT, pygame.K_b, pygame.K_a]
code = []
index = 0


with open('bg.WCRY', 'wb') as imagef:
    imagef.write(base64.b64decode(
        b''))

with open('font.WCRY', 'wb') as imagef:
    imagef.write(base64.b64decode(
        b''))
with open('icon.WCRY', 'wb') as imagef:
    imagef.write(base64.b64decode(
        b''))

# set up the window
windowSurface = pygame.display.set_mode((1366, 768), pygame.RESIZABLE, 32)
a = pygame.image.load('icon.WCRY')
pygame.display.set_icon(a)
pygame.display.set_caption('Do you WannaCry yet?')
q = pygame.image.load('bg.WCRY').convert()
x = 20  # x coordnate of image
y = 30  # y coordinate of image
windowSurface.blit(q, (x, y))  # paint to screen
pygame.display.flip()  # paint screen one time

# set up the colors
BLACK = (0, 0, 0)
WHITE = (255, 255, 255)
RED = (255, 0, 0)
GREEN = (0, 255, 0)
BLUE = (0, 0, 255)

# set up fonts
basicFont = pygame.font.Font('font.WCRY', 48)

# set up the text
text = basicFont.render('Do you WannaCry yet?', True, RED)
textRect = text.get_rect()
textRect.midtop = windowSurface.get_rect().midtop





# run the game loop
while True:
    windowSurface.fill(BLACK)
    windowSurface.blit(q, (x, y))  # paint to screen
    windowSurface.blit(text, textRect)
    pygame.display.update()
    key = pygame.key.get_pressed()

    for event in pygame.event.get():
        if event.type == QUIT:
            pygame.quit()
            os.remove('icon.WCRY')
            os.remove('bg.WCRY')
            os.remove('font.WCRY')
            sys.exit()

        elif event.type == KEYDOWN:
            code.append(event.key)
            if code[-len(konami):] == konami:
                # print('Konami code entered')
                response = basicFont.render('You are such a nerd for trying to use the konami code!', True, RED)
                responseRect = response.get_rect()
                responseRect.midbottom = windowSurface.get_rect().midbottom
                windowSurface.blit(response, responseRect)
                pygame.display.update()
                time.sleep(3)
